    // Function to calculate the result for a student (replace with your actual implementation)
    async function calculateResult(student) {
      // ... (your calculation logic here)
      let totalCredits = 0;
      let totalWeightedGrade = 0;
    
      for (const subject of student.subjects) {
        const grade = subject.grade;
        const credits = subject.credits;
    
        let gradeValue = 0;
        switch (grade) {
          case 'A+':
            gradeValue = 10;
            break;
          case 'A':
            gradeValue = 9;
            break;
          case 'B':
            gradeValue = 8;
            break;
          case 'C':
            gradeValue = 7;
            break;
          case 'D':
            gradeValue = 6;
            break;
          case 'E':
            gradeValue = 5;
            break;
          default:
            gradeValue = 0;
        }
    
        totalCredits += credits;
        totalWeightedGrade += gradeValue * credits;
      }
    
      const result = totalWeightedGrade / totalCredits;
      return result;
    }
